import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav style={{ backgroundColor: '#072679', padding: '1rem' }}>
      <ul style={{ display: 'flex', gap: '2rem', listStyle: 'none', margin: 0, color: '#fff' }}>
        <li><Link to="/repair-request" style={{ color: '#fff', textDecoration: 'none' }}>Repair Request</Link></li>
        <li><Link to="/customer-dashboard" style={{ color: '#fff', textDecoration: 'none' }}>Customer Dashboard</Link></li>
        <li><Link to="/technician-dashboard" style={{ color: '#fff', textDecoration: 'none' }}>Technician Dashboard</Link></li>
        <li><Link to="/manager-dashboard" style={{ color: '#fff', textDecoration: 'none' }}>Manager Dashboard</Link></li>
        <li><Link to="/feedback" style={{ color: '#fff', textDecoration: 'none' }}>Feedback</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
